domain_model.plantuml:
@startuml

class WaterRecyclingSubsystem {
  +filterWater()
}

class WaterStorageSubsystem {
  -waterTypes: String[]
  +store()
}

class MonitoringDevice {
  +alertLSF()
  +communicateWaterQuality()
}

class DedicatedApplication {
  +retrieveData()
}

class LifeSupportFacility {
  +notify()
  +operate()
}

class DisposalSystem {
  +processWaste()
}

class Storage {
  +storeNonPerishableGoods()
  +storePerishableGoods()
}

class Sensor
class EquipmentStorage
class IceCoreStorage

class Radio {
  -batteryBackup: boolean
  -handCrankFunction: boolean
  -solarPower: boolean
}

class Camera
class Computer
class CloudStorage
class WindowsPC
class Bed
class MobileCot
class Shower
class Toilet
class Sink
class WashingMachine
class DryingMachine
class FirstAidKit
class AEDDefibrillator
class ExerciseSpace
class EatingSpace
class Table
class Chair
class RefrigerationSystem
class FreezerSystem
class Stove

class ElectricityUsageMonitor {
  +monitorEnergyConsumption()
}

class MotionSensorSwitch
class FuelStorage
class Network {
  -minimumDownloadSpeed: int
  -minimumUploadSpeed: int
}

class Database {
  +accessFiles()
}

class ControlSystem {
  -passwordProtected: boolean
}

class SmartDevice
class FireSuppressionSystem
class PotableWaterSystem
class ResearchTeam {
  +establish()
  +interface()
}

WaterRecyclingSubsystem *-- MonitoringDevice : includes a monitoring device
WaterStorageSubsystem *-- MonitoringDevice : includes a monitoring device
MonitoringDevice --> LifeSupportFacility : sends alerts and water quality data
MonitoringDevice --> DedicatedApplication : retrieves monitoring data
PotableWaterSystem --> MonitoringDevice : features visible display of pH level
MonitoringDevice --> FireSuppressionSystem : monitors for fire events
ResearchTeam --> WindowsPC : interfaces with Windows PC
ResearchTeam --> Radio : interfaces with radio system
ControlSystem --> SmartDevice : operable via smart devices
LifeSupportFacility *-- Radio : contains at least one radio

@enduml
